void oneSecTimer(){
	volatile int *clock = (int *) 0xFF202000;
	volatile int *clock2 = (int *) 0xFF202004;
	volatile int *startValLow = (int *) 0xFF202008;
	volatile int *startValHigh = (int *) 0xFF20200C;
	//50000000 in CPUlator
	//100000000 on the board
	int time = 50000000;
	*startValHigh = 2*time/(0x10000);
	*startValLow = 2*time%(0x10000);
	*clock2 = 6; //Set start 1 and cont bit 0
}

void wait(int counter){
	volatile int *clock = (int *) 0xFF202020;
	volatile int *clock2 = (int *) 0xFF202024;
	volatile int *startValLow = (int *) 0xFF202028;
	volatile int *startValHigh = (int *) 0xFF20202C;
	//500000 in CPUlator
	//100000000 on the board
	int time = 5000000;
	*startValHigh = time/(0x10000);
	*startValLow = time%(0x10000);
	*clock2 = 6; //Set start and cont bits to 1
	for (int i = 0; i < counter; i++){
		while(1){
			if(*clock%2 == 1){ //if TO bit = 1, then break
				break;
			}
		}
		*clock = 1; //reset by writing 1 into timer
	}
	*clock2 = 8;
	
}

void plot_pixel(int x, int y, short int line_color) { //this function changes colour of a particular pixel at x, y, using pixel_buffer_address as starting point
  volatile short int* one_pixel_address; //holds 32 bit address to a short int, since each pixel is 16 bits

  one_pixel_address = (short int*) (pixel_buffer_start + (y << 10) + (x << 1));  // pixel_buffer_start has back buffer register contents
                 // (address to what acts as back buffer)

  *one_pixel_address = line_color;  // change value of the pixel itself
                                    // (changing value at pixel address)
}

