void wait_for_vsync(volatile int* base_ptr) { //wait for swap to happen
  // write 1 into front buffer register
  *base_ptr =1;  // store 1 into front buffer register to begin swapping process
  register int statusreg =
      *(base_ptr + 3);  // extract status register contents to begin polling
  while ((statusreg & 0x01) != 0) {  // polling until S bit turns into 0
    statusreg = *(base_ptr + 3);
  }
}

