void player(int* bullet, int* move, int OneMeansUseKeys){ //handles game decisions for each player's turn choosing
   	volatile int *clock1 = (int *)0xFF202000;
	volatile int *KEY_ptr = (int *)0xFF200050;
	volatile int *KEYBRD_ptr = (int *)0xFF200100;
	volatile int *LEDR_ptr = (int *)0xFF200000;
	int turnContinue = 1; 
	int key = 0;
	int keyPress = 0;
	int timeLeft = 0x800; //2^11
	int counter = 11;

	*LEDR_ptr = timeLeft;
	//polling the move
  	//while loop repeats until switch_ != switchStartValue (exits loop when any switch is toggled)
	while(turnContinue){ //depending on what key/switch is pressed, display on HEX
		//this while loop counts down while player makes a decision
		if (((*KEYBRD_ptr == 0xF0) || (keyPress == 0x80f0)) && !OneMeansUseKeys){ //if keys are not being used
			while(1){ //wait for the next value after F0 (F0 means key is lifted)
				if (*KEYBRD_ptr != 0xF0){ //when key is released
					oneSecTimer(); //counts down a second
					break;
				}
			}
			keyPress = *KEYBRD_ptr; //store the value after key was lifted
			key = getKeyboardKey(keyPress); //assign keyboard value to a number
		}
		
		if (OneMeansUseKeys==1){
		 key = *KEY_ptr;
		}
		
		if((key==1)||((key==2)&&((*bullet)<5))||((key==4)&&((*bullet)>0))){
			*move = key;
			if(*move ==1){hexdisplay("shield",0);}
			if(*move ==2){hexdisplay("reload",0);}
			if(*move ==4){hexdisplay("shoot",0);}
		}
		if((key==2)&&!(*bullet<5)){
			hexdisplay("you have enough bullets", 1);
		}
		if((key==4)&&!(*bullet>0)){
			hexdisplay("you need bullets", 1);
		}
		
		if (*clock1 %2 == 1){ //if 1 second timer finished counting down
			timeLeft = timeLeft/2; //divide by 2 --> decrement by 1
			*clock1 = 1;
			
			//depending on time left value, print out corresponding VGA counter display
			counter--;
			if (counter >= 0){ //if counter is greater than zero
				
				printcountdown(counter);

			}

		}
		
		*LEDR_ptr = timeLeft;
		if (key == 8){turnContinue = 0;} 
		if (timeLeft==0){turnContinue = 0;}
	    //i deleted the switch stuff here because i didnt understand why we have it
	    //plus the TA said we should use a timer instead or keys instead of a switch
		key = 0; //this is important to reset key when using keyboard
		keyPress = *KEYBRD_ptr; //set here
	}
	
	//handles bullet count after the move is made
	if(*move==4){//shoot
		*bullet = *bullet -1;
	}
	else if(*move==2){//reload
		*bullet = *bullet + 1;
	}
}
	
