//----functions for player names:

void charCombine(char word1[], char word2[], char *combined) {
	int length1 = strlen(word1);
	int length2 = strlen(word2);
	
	for (int i = 0; i < length1; ++i) {
        combined[i] = word1[i];
    }
	for (int i = length1; i < length1+length2; ++i) {
        combined[i] = word2[i-length1];
    }
}

void playerGetName(char *namePlayer) {
    // Corrected string initializer	
	int counter = 0;
	char character;
	char namePlayerTemp[11] = {};
	while (1){
		character = getKey4Name();
		if ((character == '.') || (counter > 10)){
			break;
		}
		if (character == '-'){
			counter= counter - 1;
			character = ' ';
			namePlayerTemp[counter] = character;
			hexdisplaystatic(namePlayerTemp, 0);
			continue;
		}
		if (character == ' '){
			continue;
		}
		if (character == '-'){
			character = ' ';
		}
		
		namePlayerTemp[counter] = character;
		hexdisplaystatic(namePlayerTemp, 0);
		counter= counter + 1;
	}
    
    // Copy the contents of namePlayerTemp to namePlayer
    for (int i = 0; i < counter; ++i) {
        namePlayer[i] = namePlayerTemp[i];
    }
}

char getKey4Name(){
	volatile int *KEYBRD_ptr = (int *)0xFF200100;
	int keyPress;
	while (*KEYBRD_ptr != 0xF0){
		keyPress = *KEYBRD_ptr;
	} //wait until it is released
	while (*KEYBRD_ptr == 0xF0){
		keyPress = *KEYBRD_ptr;
	}
	keyPress = *KEYBRD_ptr; //store last value just to make sure
	return keyPress2Alphabet(keyPress); //convert to char value and return it
}

