void hexdisplaystatic(char word[],int leave){
	//the leave does absolutely nothing,im just keeping it in case it turns out to be useful
	volatile int *HEX0 = (int *) 0xFF200020;
	volatile int *HEX4 = (int *) 0xFF200030;
	
	char longLetters[]={'w','m','t'};
	int wordLength = strlen(word);
	int display[100]={};
	int displayNum = 0;
	
	for (int i = 0; i < wordLength; ++i){
		display[displayNum] = char2Num(word[i],longLetters);
		if (display[displayNum]==128){ //for longer letters
			display[displayNum] = longchar2Num1(word[i],longLetters);
			display[displayNum+1] = longchar2Num2(word[i],longLetters);
			displayNum++;
		}
		displayNum++;
	}
	
	int displaylength = displayNum;
	
	*HEX0 = 0;
	*HEX4 = 0;
	if (displaylength<7){
	*HEX0 = display[5]+display[4]*(0x100)+display[3]*(0x10000)+display[2]*(0x1000000);
	*HEX4 = display[1]+display[0]*(0x100);
	}
	else {
	*HEX0 = display[displaylength-1]+display[displaylength-2]*(0x100)+display[displaylength-3]*(0x10000)+display[displaylength-4]*(0x1000000);
	*HEX4 = display[displaylength-5]+display[displaylength-6]*(0x100);
	}
	

}

//----function to use the keyboard during the gameplay:
int getKeyboardKey(int keyPress) {
	int key = 0;
		if (keyPress == 0x6B) {
			key = 4; // shoot
		}
		else if (keyPress == 0x75) {
			key = 2; // reload
		}
		else if (keyPress == 0x74) {
			key = 1; // shield
		}
		else if (keyPress == 0x5A) {
			key = 8; // enter means the players has locked their move
		}
	return key;
}

